import React, { Component } from 'react';
import './title.css';

export class Title extends Component {
    render() {
        return (
            <div className="headerTitle">
                <p className="h1 text-center">Your first step in tech career</p>
                <p className="h5 text-center">find your first job in tech industry</p>
            </div>
        )
    }
}

export default Title
